<?phprequire __DIR__ . '/../config.php';$url = 'https://www.stanserhorn.ch/';$htmlParser = new \Nemundo\Crawler\HtmlParser\HtmlParser();$htmlParser->fromUrl($url);(new \Nemundo\Core\Debug\Debug())->write('Language: ' . $htmlParser->getLanguage());(new \Nemundo\Core\Debug\Debug())->write('Page Title: ' . $htmlParser->getPageTitle());(new \Nemundo\Core\Debug\Debug())->write('Video:');foreach ($htmlParser->getVideoList() as $item) {    (new \Nemundo\Core\Debug\Debug())->write($item);}(new \Nemundo\Core\Debug\Debug())->write('Paragraph:');foreach ($htmlParser->getParagraphList() as $item) {    (new \Nemundo\Core\Debug\Debug())->write($item);}